import React, { Component } from "react";
import Boy from "./Boy";

class Content extends Component {
    constructor(props){
        super(props);
    }
    render() {
        if(this.props.first){
        return (
            <div id="content">
                <Boy/>
            </div> 
        );
        }
        else{
            <div id="content">
                <Boy/>
            </div> 
        }
    }
}

export default Content;
